import React, { Component } from "react";
import axios from "axios";
import Comuna from "../Post/Comuna";


class ComunaWS extends Component{

    state={
        Comuna:[]
    }

    async componentIDMount(){
        axios.get('http://localhost:4000/API/comuna')
        .then(response =>{
            this.setState({
                Comuna : response.data
            })
        })

    }

    render(){

        return(
            <React.Fragment>
                <div className="container">
                    <table className="table table-hover">
                    <thead>
                            <tr>
                            <th scope="col">ID</th>
                            <th scope="col">Nombre</th>
                            <th scope="col">Id Region</th>
                            </tr>
                        </thead>
                        <tbody>
                        {this.state.Comuna.map(()=>{
                            return(
                                <tr keys={Comuna.id_com}>
                                    <td>{comuna.nom_com}</td>
                                    <td>{comuna.id_rgn}</td>
                                </tr>
                            )
                        })}
                        </tbody>
                    </table>
                </div>


            </React.Fragment>
        );       

    }
}

export default ComunaWS
